import React,{useEffect,useState} from 'react';
import './App.css';

function App() {
  const [backendData, setBackndData] = useState([{}]);

  useEffect(() =>{
    fetch("/api").then(
      response => response.json()
    ).then(
      data=>{
        setBackndData(data)
      }
    )
  })
  return (
    <div className="App">

    </div>
  );
}

export default App;
